import React from 'react';
import './cta.css';

const CTA = () => (
  <div className="ytsp__cta">
    <div className="ytsp__cta-content">
      <p>Contribute by Checking Previous Releases</p>
      <h3>Interested to Contribute for the Youtube Spam Purge Tool?</h3>
    </div>
    <div className="ytsp__cta-btn">
      <button type="button" href>Contribute</button>
    </div>
  </div>
);

export default CTA;
